import React from 'react'
import DataDiri from '../components/form-formik/dataDiri'
import DataAlamat from '../components/form-formik/dataAlamat';

const checkStepForm = (params) => {
  switch (params) {
    case 1:
      return <DataDiri />

    case 2:
      return <DataAlamat />
    default:
      break;
  }
}

function login() {
  return (
    <div>
      <DataDiri />
    </div>
  )
}

export default login
